import React from 'react';

export const Tab = (props) =>
{
    const eventHandler = (val) => {
        props.setClicked(!props.clicked);
        if (!props.clicked){
            props.setActiveTag(val);
        }
        else {
            props.setActiveTag("");
        }
    };

    return (
        <button className="text-gray-500 py-2 px-4 text-s font-bold" onClick={() => eventHandler(props.text)}>{props.text}</button>

    )
};
